import React, {Component} from "react";
import {Link} from "react-router-dom";

export default class Home extends Component {
  render() {
    return (
      <div className="home">
        <h1>Welcome to TrackBackers</h1>
        <h3>Begin by clicking below to add track:</h3>

        <Link to="/tracks/new">
          <img
            src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fgiphy.com%2Fgifs%2Fif9vOdfngC5hxU5EHn%2Fhtml5&psig=AOvVaw3vhlWkkdtzoCjaKkGhEWLc&ust=1604798495025000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCMD-8bai7-wCFQAAAAAdAAAAABAt"
            className="home-icon"
            alt="logo"
          />{" "}
        </Link>
      </div>
    );
  }
}
